import React, { useState} from 'react';



function App(){
	let number=new Date().toLocalTimeString;
	let [current, update]=useState(number);
	function Num(){
		
	number=new Date().toLocalTimeString;
		
		update(number);
	}
	
	return(
		<>
			<h1>{current}</h1>
			<button onClick={Num}>click me</button>
		</>
	)
	
}
export default App;
